sys_variable_value.value:
(function execute(inputs, outputs) {

    var deckSize = inputs.deck_size;
 var assignedPositionsCsv = inputs.assigned_positions_csv || "";
    var uniquePosition =  getUniqueRandomPosition(deckSize, assignedPositionsCsv);
    
    outputs.unique_position_number = uniquePosition;

    // Append the new position to the CSV string
    if (assignedPositionsCsv.length > 0) {
        assignedPositionsCsv += ",";
    }
    assignedPositionsCsv += uniquePosition;

    outputs.updated_assigned_positions_csv = assignedPositionsCsv;

function getUniqueRandomPosition(deckSize, assignedPositionsCsv) {
    let assignedPositions = assignedPositionsCsv.split(',').map(Number);
    let position;

    do {
        position = Math.floor(Math.random() * deckSize) + 1;
    } while (assignedPositions.includes(position));

    return position;
}

})(inputs, outputs);

